import React from "react";  
import AboutWindow from "./components/AboutWindow";
import ProjectsWindow from "./components/ProjectsWindow";
import ContactWindow from "./components/ContactWindow";
import WebampWindow from "./components/WebampWindow";

function App() {
  return (
    <div style={{ 
      width: "100vw", 
      height: "100vh", 
      background: "url('/assets/clouds2.jpg') center/cover no-repeat", 
      overflow: "hidden", 
      position: "relative" 
    }}>
      {/* Draggable windows */}
      <AboutWindow />
      <ProjectsWindow />
      <ContactWindow />
      <WebampWindow />
    </div>
  );
}

export default App;
